import React from 'react';
import picspyLogo from '../assets/PicSpyLogo.png';
import stats from '../assets/stats.png'
import challenge from '../assets/challenge.png'
import { Slide } from 'react-slideshow-image'
import 'react-slideshow-image/dist/styles.css'
// import './Navbar.css';

export const Slider = () => {
  const slideImages = [
    {
      url: '../assets/PicSpyLogo.png',
      caption: 'Slide 1'
    },
    {
      url: { stats },
      caption: 'Slide 2'
    },
    {
      url: { challenge },
      caption: 'Slide 3'
    },
  ];

  return (
    <div className="w-1/2 m-auto pt-96">
      <Slide>
        <img src={picspyLogo} alt="slide" />
        <img src={stats} alt="slide" />
      </Slide>
    </div>
  );
};
